import { nanoid } from 'nanoid'

export function resetLocalStorage () {
  localStorage.setItem('dataForCreate', 
    JSON.stringify([{
      id: nanoid(10),
      type: 'radio',
      text: '',
      answerTrue: [
          [nanoid(3), '']
      ],
      answerFalse: [
          [nanoid(3), '']
      ],
  }]))
  localStorage.setItem('dataForCreateNameTest', `""`)
}
localStorage.setItem('dataForCreate', 
  JSON.stringify([{
    id: nanoid(10),
    type: 'radio',
    text: '',
    answerTrue: [
        [nanoid(3), '']
    ],
    answerFalse: [
        [nanoid(3), '']
    ],
}]))
localStorage.setItem('dataForCreateNameTest', `""`)
